import React from "react";

const Table = ({ formData }) => {
  const list = [
    {
      date: "2023/13/24",
      item: "Milk",
      qty: 5,
      fee: 55,
    },
    {
      date: "2023/13/24",
      item: "Milk",
      qty: 5,
      fee: 55,
    },
    {
      date: "2023/13/24",
      item: "Milk",
      qty: 5,
      fee: 55,
    },
    {
      date: "2023/13/24",
      item: "Milk",
      qty: 5,
      fee: 55,
    },
  ];

  return (
    <table className="table table-striped table-hover">
      <thead>
        <tr>
          <th>Date</th>
          <th>Item</th>
          <th>Qty</th>
          <th>Fee</th>
        </tr>
      </thead>
      <tbody>
        {formData.map((item, index) => {
          return (
            <tr key={index}>
              <td>{item.date}</td>
              <td>{item.item}</td>
              <td>{item.qty}</td>
              <td>{item.price}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default Table;
